INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Arjeplog","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__426__,__LATITUDE__:__66.05173__,__LONGITUDE__:__17.88606__,__GEOBASE__:__geonames__,__GEOBASEID__:__2725372__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Arjeplog has a subarctic climate typical of northern Sweden. Its winters are somewhat moderated by the mild maritime North Atlantic air to the west, although they are still very cold, long and snowy. Summers are short but can occasionally be warm and they also very bright due to Arjeplog's position close to the Arctic Circle. Daylight is sparse in winter, but during summer midnight sun is present for three weeks.[5] For an even longer period than that it does not get dark in Arjeplog. The presence of the midnight sun is in spite of Arjeplog being below the Arctic Circle, and is caused by the sun's trajectory not quite dropping below 0__,__° in angle. As it is below the line Arjeplog does not experience complete lack of daylight during the winter solstice, but it is limited to less than three hours.__,__Arjeplog is located on the lake of Hornavan, that freezes over every winter due to the cold temperatures, whereas the lake temperatures remain cool also in summer.__]}","Lapland","Norrbotten County","Arjeplog Municipality","-","{__CITY__:__2.29 km2__,__METRO__:__2.29 km2__}","-","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__287__}","-","-","-","https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/Arjeplog_kyrka-2006-07-2006.JPG/640px-Arjeplog_kyrka-2006-07-2006.JPG","https://en.wikipedia.org/wiki/Arjeplog");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Barcelona","Regional capital","Spain","{__ID__:__Europe/Madrid__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__15__,__LATITUDE__:__41.38879__,__LONGITUDE__:__2.15899__,__GEOBASE__:__geonames__,__GEOBASEID__:__3128760__}","{__CODE__:__Csa__,__SYSTEM__:__Köppen climate classification__,__climate__:[__According to the K__,__öppen climate classification, Barcelona has a maritime Mediterranean climate (Csa), with mild winters and warm to hot summers, while the rainiest seasons are autumn and spring.__,__The rainfall pattern is characterised by a short (3 months) dry season in summer, as well as less winter rainfall than in a typical Mediterranean climate.__,__This subtype, labelled as Portuguese by the French geographer George Viers after the climate classification of Emmanuel de Martonne and found in the NW Mediterranean area (e.g. Marseille), can be seen as transitional to the humid subtropical climate (Cfa) found in inland areas such as the Po Valley (e.g. Milan), whose rainfall is greater in summer, a feature of continental climates.__]}","Catalonia","Barcelona","Barcelona","343","{__CITY__:__101.4 km2__,__METRO__:__3,694.86 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__-__,__MAX__:__290__}","080xx","(+34) 93","www.barcelona.cat","https://upload.wikimedia.org/wikipedia/commons/thumb/3/3d/14-08-06-barcelona-RalfR-314.jpg/640px-14-08-06-barcelona-RalfR-314.jpg","https://en.wikipedia.org/wiki/Barcelona");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Grums","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__55__,__LATITUDE__:__59.3466__,__LONGITUDE__:__13.10906__,__GEOBASE__:__geonames__,__GEOBASEID__:__2710343__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Consistently horrible weather combined with a thick frothy smell from the paper mill.__]}","Värmlands Län","Värmland","Grums Municipality","-","{__CITY__:__478.81 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__237__,__MAX__:__290__}","664xx","(+46) 555","https://www.grums.se/","https://upload.wikimedia.org/wikipedia/commons/thumb/5/5b/Grums_railway_station_Grums_Sweden.JPG/640px-Grums_railway_station_Grums_Sweden.JPG","https://en.wikipedia.org/wiki/Grums");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Gävle","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__3__,__LATITUDE__:__60.67452__,__LONGITUDE__:__17.14174__,__GEOBASE__:__geonames__,__GEOBASEID__:__2712414__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__G__,__ävle has a similar climate to the rest of central Sweden, with an average temperature of around −10 °C (14 °F) in January and 20 °C (68 °F) in July. Yearly rainfall is around 600 mm (23.62 in). Under the Köppen climate classification Gävle is classified as humid continental, in spite of the__,__significant maritime influence. It is also one of the northernmost cities by significant size in the world with this climate type, since areas north of the 60th parallel for the most part are dominated by various subarctic climate types. Under the 1961-1990 normals, Gävle's fourth warmest month wa__,__s just around the isotherm of 10 °C (50 °F) to not be classified as subarctic, but temperatures did go up sufficiently to be clear humid continental since.__]}","Gästrikland","Gävleborg County","Gävle Municipality","-","{__CITY__:__42.45 km2__,__METRO__:__1,615.07 km2__}","8 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__17__,__MAX__:__290__}","80x xx","(+46) 26","www.gavle.se","https://upload.wikimedia.org/wikipedia/commons/2/26/G%C3%A4vle-Gamla_Stan.JPG","https://en.wikipedia.org/wiki/G%C3%A4vle");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Gothenburg","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__10__,__LATITUDE__:__57.70716__,__LONGITUDE__:__11.96679__,__GEOBASE__:__geonames__,__GEOBASEID__:__2711537__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Gothenburg has a warm-summer humid continental climate using the 0__,__°C isotherm (Köppen Dfb) and an oceanic climate using the -3 °C isotherm (Köppen Cfb) according to the Köppen climate classification. Despite its northern latitude, temperatures are quite mild throughout the year and warmer than places in similar latitude, for example, Stockholm, or even somewh__,__at further south, mainly because of the moderating influence of the warm Gulf Stream.[39] During the summer, daylight extends 18 hours and 5 minutes, but lasts 6 hours and 32 minutes in late December. The climate has become significantly milder in later decades, particularly in summer and winter; Ju__,__ly temperatures used to be below Stockholm's 1961–1990 averages, but have since been warmer than that benchmark.__,__Summers are warm and pleasant with average high temperatures of 19 to 20__,__°C (66 to 68 °F) and lows of 10 to 12 °C (50 to 54 °F), but temperatures of 25–30 °C (77–86 °F) occur on many days during the summer. Winters are cold and windy with temperatures of around −3 to 3 °C (27 to 37 °F), though it rarely drops below −20 °C (−4 °F). Precipitation is reg__,__ular but generally moderate throughout the year. Snow mainly occurs from December to March, but is not unusual in November and April and can sometimes occur even in October and May, in extreme cases even in September.[45]__]}","Västergötland and Bohuslän","Västra Götaland County","Gothenburg Municipality","1621","{__CITY__:__447.76 km2__,__METRO__:__3,694.86 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__2__,__MAX__:__290__}","40xxx– 41xxx – 421xx – 427xx","(+46) 31","goteborg.se","https://upload.wikimedia.org/wikipedia/commons/2/26/G%C3%A4vle-Gamla_Stan.JPG","https://en.wikipedia.org/wiki/Gothenburg");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Halmstad","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__11__,__LATITUDE__:__56.67446__,__LONGITUDE__:__12.85676__,__GEOBASE__:__geonames__,__GEOBASEID__:__2708365__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Halmstad has the south Scandinavian variety of the relatively wet humid continental climate (Dfb) with warm summers and cold winters, closely bordering on an oceanic climate (Cfb).__]}","Halland","Halland County","Halmstad Municipality","1307","{__CITY__:__34.13 km2__,__METRO__:__1,018.46 km2__}","11 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__18__,__MAX__:__290__}","30x xx","(+46) 35","www.halmstad.se","https://upload.wikimedia.org/wikipedia/commons/thumb/c/cd/Halmstad_Nissan01.JPG/640px-Halmstad_Nissan01.JPG","https://en.wikipedia.org/wiki/Halmstad");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Havana","Capital","Cuba","{__ID__:__America/Havana__,__UTCOFFSETMINUTES__:__-240__}","{__ALTITUDE__:__41__,__LATITUDE__:__23.13302__,__LONGITUDE__:__-82.38304__,__GEOBASE__:__geonames__,__GEOBASEID__:__3553478__}","{__CODE__:__Aw__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Havana, like much of Cuba, has a tropical climate that is tempered by the island's position in the belt of the trade winds and by the warm offshore currents.__,__Under the K__,__öppen climate classification, Havana has a tropical savanna climate that closely borders on a tropical monsoon climate. Average temperatures range from 22 °C (72 °F) in January and February to 28 °C (82 °F) in August. The temperature seldom drops below 10 °C (50 °F). The lowest temperature wa__,__s 1 °C (34 °F) in Santiago de Las Vegas, Boyeros__]}","La Habana","-","La Habana","1519","{__CITY__:__781.58 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__-__,__MAX__:__290__}","10xxx–19xxx","(+53) 07","www.lahabana.gob.cu","https://upload.wikimedia.org/wikipedia/commons/thumb/0/04/Havana_Cathedral_crop.jpg/547px-Havana_Cathedral_crop.jpg","https://en.wikipedia.org/wiki/Havana");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Helsingborg","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__13__,__LATITUDE__:__56.04673__,__LONGITUDE__:__12.69437__,__GEOBASE__:__geonames__,__GEOBASEID__:__2706767__}","{__CODE__:__Cfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Helsingborg has an oceanic climate typical of southern Sweden, although its winters are very mild for a location at such a high latitude. Although the temperature differences between seasons are significant, Helsingborg often lacks a meteorological winter with both January and February averaging just above the freezing point in terms of mean temperatures.__]}","Scania","Skåne County","Helsingborg Municipality","1085","{__CITY__:__38.41 km2__,__METRO__:__423.08 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__8__,__MAX__:__290__}","25X XX","(+46) 42","www.helsingborg.se","https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Fredriksdals_stadskvarter_B%C3%85n.JPG/640px-Fredriksdals_stadskvarter_B%C3%85n.JPG","https://en.wikipedia.org/wiki/Helsingborg");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Hudiksvall","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__2__,__LATITUDE__:__61.72897__,__LONGITUDE__:__17.10358__,__GEOBASE__:__geonames__,__GEOBASEID__:__2704613__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Hudiksvall has a humid continental climate with a significant maritime influence. In the 1961-1990 reference period it was just above subarctic, but that border region has since moved somewhat further north.__,__Considering how far north it is, the climate is comparatively mild, with warm summers and moderated winters with daytime highs often hovering around the freezing point.__,__Hudiksvall has a relatively wet climate with an annual precipitation rate averaging 646 millimetres (25.4 in) sometimes resulting in heavy snowfall during winters.__]}","Hälsingland","VGävleborg County","Hudiksvall Municipality","1582","{__CITY__:__10.08 km2__,__METRO__:__4 524,18 km2__}","2 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__70__,__MAX__:__290__}","824xx","(+46) 650","hudiksvall.se/","https://upload.wikimedia.org/wikipedia/commons/thumb/1/14/Hudiksvall2010b.JPG/640px-Hudiksvall2010b.JPG","https://en.wikipedia.org/wiki/Hudiksvall");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Jokkmokk","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__251__,__LATITUDE__:__66.60665__,__LONGITUDE__:__19.82324__,__GEOBASE__:__geonames__,__GEOBASEID__:__2702997__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Influenced by its inland and northerly position, Jokkmokk's variety of a subarctic climate is very cold even by Swedish standards. Summers are normally relatively mild in spite of the day-round light and the dark winters are long and cold.__]}","Lapland","Norrbotten","Jokkmokk Municipality","1611","{__CITY__:__3.59 km2__,__METRO__:__19 334,08 km2__}","257 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__275__,__MAX__:__290__}","962xx","(+46) 971","www.jokkmokk.se","https://upload.wikimedia.org/wikipedia/commons/thumb/5/5e/J%C3%A4rnv%C3%A4gsstation-Jokkmokk.JPG/640px-J%C3%A4rnv%C3%A4gsstation-Jokkmokk.JPG","https://en.wikipedia.org/wiki/Jokkmokk");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Jönköping","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__100__,__LATITUDE__:__57.78145__,__LONGITUDE__:__14.15618__,__GEOBASE__:__geonames__,__GEOBASEID__:__2702979__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__J__,__önköping's climate was humid continental (Köppen Dfb) with long, cold winters and short, warm summers during the 1961–1990 period. However, the window between subarctic and oceanic is very small in this marine-influenced climate type, and in recent years the climate has more resembled very cold__,__oceanic.__,__However, figures are slightly skewed due to the weather station being located at the airport which is at an elevation of 228 metres (748 ft), whereas the city centre is at 100 metres (330 ft). This likely renders up to between half a degree to a full degree milder temperatures in the urban centre.__]}","Småland","Jönköping County","Jönköping Municipality","1284","{__CITY__:__44.82 km2__,__METRO__:__1924,97 km2__}","104 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__10__,__MAX__:__290__}","55xxx - 561xx - 562xx","(+46) 36","jonkoping.se","https://upload.wikimedia.org/wikipedia/commons/thumb/7/71/J%C3%B6nk%C3%B6pings_r%C3%A5dhus%2C_2018.jpg/640px-J%C3%B6nk%C3%B6pings_r%C3%A5dhus%2C_2018.jpg","https://en.wikipedia.org/wiki/J%C3%B6nk%C3%B6ping");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Kalmar","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__7__,__LATITUDE__:__56.66157__,__LONGITUDE__:__16.36163__,__GEOBASE__:__geonames__,__GEOBASEID__:__2702261__}","{__CODE__:__Cwc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Kalmar has a cold oceanic climate. It is somewhat continental with warm summers and cold winters which normally averages just above the freezing point during days and goes somewhat below it at night.__,__It has some of the hottest temperatures recorded by Swedish cities for most months, with an all-time record of 35.2__,__°C (95.4 °F).[7] The average summer temperatures however are quite normal for southern Sweden.__]}","Småland","Kalmar County","Kalmar Municipality","1100","{__CITY__:__19.50 km2__,__METRO__:__1 250,98 km2__}","8 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__33__,__MAX__:__290__}","39X XX","(+46) 480","kalmar.se","https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Kalmar_cathedral_Kalmar_Sweden_001.JPG/640px-Kalmar_cathedral_Kalmar_Sweden_001.JPG","https://en.wikipedia.org/wiki/Kalmar");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Karlskrona","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__18__,__LATITUDE__:__56.16156__,__LONGITUDE__:__15.58661__,__GEOBASE__:__geonames__,__GEOBASEID__:__2701713__}","{__CODE__:__Cfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__The climate is damp, warm and temperate. The rainfall in Karlskrona is significant, with precipitation even during the driest month.__,__The climate is classified as Cfb by the K__,__öppen-Geiger system. The average annual temperature is 7.8 °C | 46.0 °F in Karlskrona. About 556 mm | 21.9 inch of precipitation falls annually.__]}","Blekinge","Blekinge County","Karlskrona Municipality","1680","{__CITY__:__21.72 km2__,__METRO__:__3 344,74 km2__}","16 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__35__,__MAX__:__290__}","371 XX","(+46) 455","karlskrona.se","https://upload.wikimedia.org/wikipedia/commons/thumb/c/c0/Amiralitetskyrkan._s.w.JPG/640px-Amiralitetskyrkan._s.w.JPG","https://en.wikipedia.org/wiki/Karlskrona");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Karlstad","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__58__,__LATITUDE__:__59.3793__,__LONGITUDE__:__13.50357__,__GEOBASE__:__geonames__,__GEOBASEID__:__2701680__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Karlstad has a humid continental climate (Dfb) with influence from the surrounding waters of V__,__änern and the inflow from the Atlantic Ocean.__,__It has large differences between seasons and is moderately influenced by both marine and land airflows. The highest recorded temperature since 1901 is 34.0__,__°C (93.2°F) in July 1933 and the lowest is -36.0°C (-32.8°F) from February 1966.__]}","Värmland","Värmland County","Karlstad Municipality","1584","{__CITY__:__30.31 km2__,__METRO__:__1 517,74 km2__}","64 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__22__,__MAX__:__290__}","65X XX","(+46) 54","karlstad.se","https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Jvstn_Karlstad.jpg/640px-Jvstn_Karlstad.jpg","https://en.wikipedia.org/wiki/Karlstad");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Kiruna","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__579__,__LATITUDE__:__67.85572__,__LONGITUDE__:__20.22513__,__GEOBASE__:__geonames__,__GEOBASEID__:__605155__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Being located 145 km (90 miles) north of the Arctic Circle, Kiruna has a subarctic (Dfc) climate with short, cool summers and long, cold winters, although the city itself can be considerably milder than the surrounding forest. Snow cover generally lasts from late September to mid-May, but snowfall can occur year-round.__,__The sun does not set between 28 May and 16 July (50 days), and white nights lasts from early May to early August. The period that the sun does not rise lasts from 11 December to 1 January (22 days), the exact boundaries depending on local topography.__,__Even though Kiruna's winters are very cold by Swedish standards, they are still much less severe than winters on similar latitudes in North America and Siberia, and even more southerly areas in other parts of the world due to some maritime influence.__,__Similar winter temperatures go as far south as below the 45th parallel in the Russian Far East. Kiruna however, has cooler summers than such areas, but still warm enough to stay above polar climate and below the northern tree line.__,__Winter temperatures however are significantly colder than areas immediately affected by the Gulf Stream such, where in fact the regular lows of Kiruna during January and February are colder than or similar to Troms__,__ø's all-time record low.__]}","Lapland","Norrbotten County","Kiruna Municipality","1948","{__CITY__:__16.53 km2__,__METRO__:__20 553,28 km2__}","550 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__113__,__MAX__:__290__}","981xx","(+46) 980","kiruna.se","https://upload.wikimedia.org/wikipedia/commons/thumb/b/bf/Church_of_Kiruna_2011.jpg/640px-Church_of_Kiruna_2011.jpg","https://en.wikipedia.org/wiki/Kiruna");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Kristianstad","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__8__,__LATITUDE__:__56.03129__,__LONGITUDE__:__14.15242__,__GEOBASE__:__geonames__,__GEOBASEID__:__2699310__}","{__CODE__:__Cwa__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Kristianstad has a humid continental climate but with the updated mean annual temperature can qualify for a humid subtropical climate which is very unusual for a city this far north.__,__The city being lowest point in Sweden might explain the hot climate. Summers are warm and comparatively long by Swedish standards.__]}","Scania","Skåne County","Kristianstad Municipality","1614","{__CITY__:__21.4 km2__,__METRO__:__1 820,76 km2__}","-2,4 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__25__,__MAX__:__290__}","291 XX","(+46) 44","kristianstad.se","https://upload.wikimedia.org/wikipedia/commons/f/f0/Kristianstad_070628-4.JPG","https://en.wikipedia.org/wiki/Kristianstad");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Luleå","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__17__,__LATITUDE__:__65.58415__,__LONGITUDE__:__22.15465__,__GEOBASE__:__geonames__,__GEOBASEID__:__604490__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Lule__,__å has a subarctic climate (Köppen: Dfc), which borders on a continental climate (Köppen: Dfb) with short, mild to warm summers and long, cold, snowy winters.__,__Due to the Gulf Stream, Lule__,__å has a warmer climate than other cities on the same latitude and even some that are further south in Canada, Alaska, Northeast China and Siberia. During the summer in June and July the temperature in Luleå can some days rise to around +30 degrees Celsius.__,__Summers are very bright, with marginal twillight being the only exception during the summer solstice.__]}","Norrbotten","Norrbotten County","Luleå Municipality","1621","{__CITY__:__29.09 km2__,__METRO__:__4 911,97 km2__}","6 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__28__,__MAX__:__290__}","97X XX","(+46) 920","www.lulea.se","https://upload.wikimedia.org/wikipedia/commons/6/6b/Karlskrona_Trefaldighetskyrkan.jpg","https://en.wikipedia.org/wiki/Luleå");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Malmö","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__10__,__LATITUDE__:__55.60587__,__LONGITUDE__:__13.00073__,__GEOBASE__:__geonames__,__GEOBASEID__:__2692969__}","{__CODE__:__Cfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Malm__,__ö, like the rest of southern Sweden, has an oceanic climate. Despite its northern location, the climate is mild compared to other locations at similar latitudes, mainly because of the influence of the Gulf Stream and also its westerly position on the Eurasian landmass. Owing to its northern latitud__,__e, daylight lasts 17 hours in midsummer, but only around seven hours in midwinter. According to data from 2002–2014 Falsterbo, to the south of the city, received an annual average of 1,895 hours of sunshine while Lund, to the north, received 1,803 hours. The sunshine data in the weather box is bas__,__ed on the data for Falsterbo.[14]__,__Summers are mild with average high temperatures of 20 to 23__,__°C (68 to 73 °F) and lows of around 11 to 13 °C (52 to 55 °F). Heat waves during the summer arise occasionally. Winters are fairly cold and windy, with temperatures steady between −3 to 4 °C (27 to 39 °F), but it rarely drops below −10 °C (14 °F).__,__Rainfall is light to moderate throughout the year with 169 wet days. Snowfall occurs mainly in December through March, but snow covers do not remain for a long time,[15] and some winters are virtually free of snow.__]}","Scania","Skåne County","Malmö Municipality","1275","{__CITY__:__332.6 km2__,__METRO__:__2,522 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__3__,__MAX__:__290__}","2xxxx","(+46) 40","www.malmo.se","https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/Vattentornet_vid_Pildammarna.jpg/640px-Vattentornet_vid_Pildammarna.jpg","https://en.wikipedia.org/wiki/Malmö");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Oslo","Capital","Norway","{__ID__:__Europe/Oslo__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__10__,__LATITUDE__:__59.912726542422__,__LONGITUDE__:__10.7460923576733__,__GEOBASE__:__ssr__,__GEOBASEID__:__72837__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Oslo has a humid continental climate (K__,__öppen climate classification Dfb) with warm summers and cold winters. Due to oceanic influences, winters are less cold than more continental areas at same latitude. With −3 °C (27 °F) isotherm, it is also reasonable for Oslo to be classified as a borderline oceanic climate.__,__Oslo has a significant amount of rainfall during the year. This is true even for the driest month. Because of the city's northern latitude, daylight varies greatly, from more than 18 hours in midsummer, when it never gets completely dark at night (no darker than nautical twilight), to around 6 hours in midwinter. Oslo sits right on the border between hardiness zones 7a and 7b.__]}","Østlandet","Oslo County","Oslo Municipality","1048","{__CITY__:__265,29 km2__,__METRO__:__6 919,51 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__-__,__MAX__:__290__}","0001– 1299","(+47) 2","www.oslo.kommune.no","https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Astrup_Fearnley_009.JPG/640px-Astrup_Fearnley_009.JPG","https://en.wikipedia.org/wiki/Oslo");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Stockholm","Capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__28__,__LATITUDE__:__59.33258__,__LONGITUDE__:__18.0649__,__GEOBASE__:__geonames__,__GEOBASEID__:__2673730__}","{__CODE__:__Cfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Stockholm has an oceanic climate in the 0__,__°C isotherm (Köppen: Cfb)[38][39] and a humid continental climate (Dfb) in the -3 °C isotherm. Although winters are cold, average temperatures generally remain above 0 °C for much of the year.__,__Summers are mild, and precipitation occurs throughout the year. Due to the city's high northerly latitude, the length of the day varies widely from more than 18 hours around midsummer to only around 6 hours in late December.__,__The nights from late May until mid-July are bright even when cloudy. Stockholm has relatively mild weather compared to other locations at a similar latitude, or even farther south.__,__With an average of just over 1800 hours of sunshine per year, it is also one of the sunniest cities in Northern Europe, receiving more sunshine than Paris, London and a few other major European cities of a more southerly latitude.__]}","Södermanland and Uppland","Stockholm County","Stockholm Municipality","1252","{__CITY__:__381.63 km2__,__METRO__:__6,519 km2__}","28 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__1__,__MAX__:__290__}","100 00--199 99","(+46) 8","www.stockholm.se","https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Sse_north_side.jpg/640px-Sse_north_side.jpg","https://en.wikipedia.org/wiki/Gothenburg");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Sundsvall","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__26__,__LATITUDE__:__62.39129__,__LONGITUDE__:__17.3063__,__GEOBASE__:__geonames__,__GEOBASEID__:__2670781__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Sundsvall has a climate which is on the border between subarctic and cold continental, leaning towards the latter in recent years. Temperatures are made significantly milder and regulated by the influence from the Gulf Stream.__,__The weather station is located 20 kilometres (12 mi) to the north and somewhat further inland, which renders that Sundsvall's urban centre is likely milder in terms of low temperatures by some degree.__]}","Medelpad","Västernorrland County","Sundsvall Municipality","1621","{__CITY__:__27.46 km2__,__METRO__:__4 445,86 km2__}","241 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__19__,__MAX__:__290__}","85xxx","(+46) 60","sundsvall.se","https://upload.wikimedia.org/wikipedia/commons/thumb/d/db/Gustav_Adolfs_kyrka_Sundsvall.jpg/640px-Gustav_Adolfs_kyrka_Sundsvall.jpg","https://en.wikipedia.org/wiki/Sundsvall");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Uddevalla","Administration centre","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__13__,__LATITUDE__:__58.34784__,__LONGITUDE__:__11.9424__,__GEOBASE__:__geonames__,__GEOBASEID__:__2666670__}","{__CODE__:__Cfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Uddevalla lies on 21m above sea level The climate here is mild, and generally warm and temperate. Uddevalla is a city with a significant rainfall. Even in the driest month there is a lot of rain.__,__The K__,__öppen-Geiger climate classification is Cfb. The temperature here averages 7.0 °C. The annual rainfall is 750 mm.__]}","Bohuslän","Västra Götaland County","Uddevalla Municipality","1498","{__CITY__:__16.92 km2__,__METRO__:__732,1 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__43__,__MAX__:__290__}","451 XX","(+46) 522","uddevalla.se","https://upload.wikimedia.org/wikipedia/commons/thumb/1/1a/Uddevalla-badhus.jpg/640px-Uddevalla-badhus.jpg","https://en.wikipedia.org/wiki/Uddevalla");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Umeå","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__24__,__LATITUDE__:__63.82842__,__LONGITUDE__:__20.25972__,__GEOBASE__:__geonames__,__GEOBASEID__:__602150__}","{__CODE__:__Dfc__,__SYSTEM__:__Köppen climate classification__,__climate__:[__The climate of Ume__,__å is bordering on a humid continental and a subarctic climate, with short and fairly warm summers. Winters are lengthy and freezing but usually milder than in areas at the same latitude with a more continental climate.__,__Average January temperature is about__,__−7 °C (19 °F), July is 16 °C (61 °F). Considering its proximity to a major water body and its latitude, summers are warmer than would be expected.__,__The record high of 32.2__,__°C (90.0 °F) was recorded on 23 July 2014, during a very warm summer in Sweden. The record low of −38.2 °C (−36.8 °F) was recorded on 15 February 1978.__]}","Västerbotten","Västerbotten County","Umeå Municipality","1622","{__CITY__:__32.2 km2__,__METRO__:__5 277,25 km2__}","12 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__11__,__MAX__:__290__}","900 01 - 908 50","(+46) 90","umea.se","https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/Umea_radhus_from_south.jpg/640px-Umea_radhus_from_south.jpg","https://en.wikipedia.org/wiki/Ume%C3%A5");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Uppsala","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__20__,__LATITUDE__:__59.85882__,__LONGITUDE__:__17.63889__,__GEOBASE__:__geonames__,__GEOBASEID__:__2666199__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Uppsala lies immediately south of the 60th parallel north and has a humid continental climate, with cold winters and warm summers. Due to its northerly location, Uppsala experiences over 18 hours of visible sunshine during the summer solstice, and under 6 hours of sunshine during the winter solstice.__,__Despite Uppsala's northerly location, the winter is not as cold as other cities at similar latitudes, mainly due to the Gulf Stream. For example, in January Uppsala has a daily mean of__,__−2.7 °C. In Canada, at the same latitude, Fort Smith experiences a daily mean of −22.4 °C.__,__With respect to record temperatures, the difference between the highest and lowest is relatively large. Uppsala__,__’s highest recorded temperature was 37.4 °C (99.3 °F), recorded in July 1933. On the same day Ultuna, which lies a few kilometres south of the centre of Uppsala, recorded a temperature of 38 °C.__,__This is the highest temperature ever recorded in the Scandinavian Peninsula, although the same temperature was recorded in M__,__ålilla, Sweden, 14 years later.__]}","Uppland","Uppsalay","Uppsala Municipality","980","{__CITY__:__48.77 km2__,__METRO__:__2,234.34 km2__}","40 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__4__,__MAX__:__290__}","74X XX - 75X XX","(+46) 18","uppsala.se","https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/Uppsala_centralstation.jpg/640px-Uppsala_centralstation.jpg","https://en.wikipedia.org/wiki/Uppsala");
INSERT INTO LOCATION(name,type,country,timezone,geolocation,climate,province,county,municipality,charter,area,elevation,rank,postalcode,areacode,url,imgurl,hyperlink) VALUES("Örebro","Regional capital","Sweden","{__ID__:__Europe/Stockholm__,__UTCOFFSETMINUTES__:__120__}","{__ALTITUDE__:__35__,__LATITUDE__:__59.27412__,__LONGITUDE__:__15.2066__,__GEOBASE__:__geonames__,__GEOBASEID__:__2686657__}","{__CODE__:__Dfb__,__SYSTEM__:__Köppen climate classification__,__climate__:[__Örebro, like the rest of the area close to Mälardalen, has a humid continental climate (Köppen Dfb) that is made milder by the proximity to water and the Gulf Stream which makes it interchangeable with oceanic climates.__,__Summer temperatures occasionally exceed 30__,__°C (86 °F) albeit not yearly, and temperatures above 5 °C (41 °F) are rare in winter, although frost-free nights sometimes occur.__,__July high temperatures range from 20__,__°C (68 °F) to 26 °C (79 °F) depending on weather patterns, with a 2002–2014 mean high of around 23.4 °C (74.1 °F). During cold winters, Örebro receives plenty of snowfall.__,__Örebro is far more prone than coastal areas to really harsh frosts with temperatures approaching or below −20 °C (−4 °F) happening almost every winter according to SMHI statistics.__]}","Närke","Örebro County","Örebro Municipality","1404","{__CITY__:__50,6355 km2__,__METRO__:__1 620,61 km2__}","34 m","{__SOURCE__:__https://www.scb.se/hitta-statistik/statistik-efter-amne/befolkning__,__NO__:__6__,__MAX__:__290__}","701 xx -- 702 xx -- 703 xx","(+46) 19","www.orebro.se","https://upload.wikimedia.org/wikipedia/commons/thumb/5/5e/Orebro_slott_2010.JPG/640px-Orebro_slott_2010.JPG","https://en.wikipedia.org/wiki/%C3%96rebro");
